import React from "react";
import { Canvas } from 'react-three-fiber'
import "./styles.css";

function Sphere() {
  return (
    <mesh visible position={[0, 0, 0]} rotation={[0, 0, 0]}>
      <sphereGeometry attach="geometry" args={[2, 32, 32]} />
      <meshBasicMaterial
        attach="material"
        color="white"
        roughness={0.1}
        metalness={1}
      />
    </mesh>
  )
}

export default function App() {
  return (
    <Canvas></Canvas>
  );
}
